import React, { Component } from 'react';

export default class Convert extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className='conversor'>
        <h2>USD para BRL</h2>
        <input type='text'></input>
        <input type='button' value='Converter'></input>
        <h2>Valor convertido</h2>
      </div>
    );
  }
}
